class TaskList extends React.Component{

    state = {
        task: ""
    }

    render(){
        return(
            <div>
                <div>Task Manager</div>
                <input value = {this.state.task} placeholder = "your task..."/>
                <button className = "ui primary button basic">Submit</button>
            </div>
        )
    }
}
export default TaskList;
